// @material-ui/icons
import Dashboard from "@material-ui/icons/Dashboard";
import Person from "@material-ui/icons/Person";
// core components/views for Admin layout
import BusinessDetails from "./components/Configurator/BusinessDetails.js";
import LineOfBusinessOffExchange from "./components/Configurator/LineOfBusinessOffExchange.js";
import LineOfBusinessOnExchange from "./components/Configurator/LineOfBusinessOnExchange.js";
import LineOfBusinessGroup from "./components/Configurator/LineOfBusinessGroup.js";
import CarrierDetails from "./components/Configurator/CarrierDetails.js";
import StatesOffExchange from "./components/Configurator/StatesOffExchange.js";
import StatesOnExchange from "./components/Configurator/StatesOnExchange.js";
import StatesGroup from "./components/Configurator/StatesGroup.js";
import DashboardFirstPage from "./components/Configurator/Home";
import EdiParent from "./components/Configurator/EdiParent.js";
import LegalEntity1 from "./components/legalEntity/LegalEntity";
import LegalEntity2 from "./components/legalEntity/LegalEntity2";
const dashboardRoutes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    on: Dashboard,
    component: DashboardFirstPage,
    layout: "/admin"
  },
  {
    path: "/BusinessDetails",
    name: "Business Details",
    icon: Person,
    component: BusinessDetails,
    layout: "/admin"
  },
  {
    path: "/LineOfBusinessOffExchange",
    name: "Line Of Business OffExchange",
    icon: Person,
    component: LineOfBusinessOffExchange,
    layout: "/admin"
  },
  {
    path: "/LineOfBusinessOnExchange",
    name: "Line Of Business OnExchange",
    icon: Person,
    component: LineOfBusinessOnExchange,
    layout: "/admin"
  },
  {
    path: "/LineOfBusinessGroup",
    name: "Line Of Business OnExchange",
    icon: Person,
    component: LineOfBusinessGroup,
    layout: "/admin"
  },
  {
    path: "/CarrierDetails",
    name: "Carrier Details",
    icon: Person,
    component: CarrierDetails,
    layout: "/admin"
  },
  {
    path: "/StatesOffExchange",
    name: "States OffExchange",
    icon: Person,
    component: StatesOffExchange,
    layout: "/admin"
  },
  {
    path: "/StatesOnExchange",
    name: "States OnExchange",
    icon: Person,
    component: StatesOnExchange,
    layout: "/admin"
  },
  {
    path: "/StatesGroup",
    name: "States Group",
    icon: Person,
    component: StatesGroup,
    layout: "/admin"
  },
  {
    path: "/EdiParent",
    name: "EDI",
    icon: Person,
    component: EdiParent,
    layout: "/admin"
  },
  {
    path: "/LegalEntity",
    name: "LegalEntity1",
    icon: Person,
    component: LegalEntity1,
    layout: "/admin"
  },
  {
    path: "/LegalEntity2",
    name: "LegalEntity2",
    icon: Person,
    component: LegalEntity2,
    layout: "/admin"
  }
];

export default dashboardRoutes;
